import React from "react";

const img="public/unemployment.avif";
const Unemployment =()=>{
    return(
        <>
            <h1>UNEMPLOYMENT</h1>
            <img src="img" alt="{Image}"></img>
            <p>Unemployment refers to a situation where a person actively searches for employment but is unable to find work. Unemployment is considered to be a key measure of the health of the economy. The most frequently used measure of unemployment is the unemployment rate. It's calculated by dividing the number of unemployed people by the number of people in the labor force.</p>
        </>
    )
}

export default Unemployment;
